import React from 'react';
import logo from './logo.svg';
import Login from './login/Login';
import Barrasuperior from './login/Barrasuperior'
import './App.css';
import BackgroundSlideshow from 'react-background-slideshow'
import image1 from './img/login/slide-img-1.jpg'
import image2 from './img/login/slide-img-2.jpg'
import image3 from './img/login/slide-img-3.png'

function App() {
  return (
    <div>
    <Barrasuperior />
    <div className="App">
    <Login/>
      </div>
      <BackgroundSlideshow images={[image2, image1, image3]} duration={3}
        transition={2} />            
    </div>

  );
}

export default App;
